      "excerpt": "<h2 id=\"go-package-管理发展史\"><a class=\"header-anchor\" href=\"#go-package-管理发展史\">#</a> Go Package 管理发展史</h2>\n<p>Go依赖管理是通过Git仓库模式实现，并随着版本的更迭已经逐渐完善。</p>\n<ul>\n<li>\n<p>GOPAHT模式</p>\n<blockquote>\n<p>GOPATH目录是所有工程的公共依赖包目录，所有需要编译的go工程的依赖包都放在GOPATH目录下。</p>\n</blockquote>\n</li>\n<li>\n<p>Vendor特性</p>\n<blockquote>\n<p>为了解决GOPATH模式下，多个工程需要共享GOPATH目录，无法适用于多个工程对于不同版本的依赖包的使用，不便于更新某个依赖包。go1.6之后开启了vendor目录。</p>\n</blockquote>\n</li>\n<li>\n<p>Go Module包管理</p>\n<blockquote>\n<p>从go1.11以后开始支持Module依赖管理工具，从而实现了依赖包的进行升级更新，在go1.13版本后默认打开</p>\n</blockquote>\n</li>\n</ul>\n",
