      "excerpt": "<h2 id=\"gorm学习\"><a class=\"header-anchor\" href=\"#gorm学习\">#</a> gorm学习</h2>\n<p><a href=\"https://gorm.io/zh_CN/docs/index.html\" target=\"_blank\" rel=\"noopener noreferrer\">官网链接<OutboundLink/></a></p>\n<p>ORM =&gt; Object Relational Mapping  对象关系型映射</p>\n<p>这里的gorm是go语言里的一个ORM的框架，基本支持主流的数据库</p>\n<p>O：对象，这里在go语言指的是结构体实例</p>\n<p>R：关系，就是对应的关系型数据库，例如MySQL</p>\n<p>M：进行映射，一一对应，结构体对应表，结构体实例对应一行记录，结构体里的字段对应表字段</p>\n<p>案例：</p>\n<!--beforebegin--><div class=\"language-go line-numbers-mode\"><!--afterbegin--><pre v-pre class=\"language-go\"><code><span class=\"token keyword\">type</span> UserInfo <span class=\"token keyword\">struct</span> <span class=\"token punctuation\">{</span>\n  ID <span class=\"token builtin\">uint</span>\n  Name <span class=\"token builtin\">string</span>\n  Gender <span class=\"token builtin\">string</span>\n  Hobby <span class=\"token builtin\">string</span>\n<span class=\"token punctuation\">}</span>\n\n<span class=\"token keyword\">func</span> <span class=\"token function\">main</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span> <span class=\"token punctuation\">{</span>\n  u1 <span class=\"token operator\">:=</span> UserInfo<span class=\"token punctuation\">{</span><span class=\"token number\">1</span><span class=\"token punctuation\">,</span> <span class=\"token string\">\"wujie\"</span><span class=\"token punctuation\">,</span> <span class=\"token string\">\"男\"</span><span class=\"token punctuation\">,</span> <span class=\"token string\">\"乒乓球\"</span><span class=\"token punctuation\">}</span>\n  orm<span class=\"token punctuation\">.</span><span class=\"token function\">Create</span><span class=\"token punctuation\">(</span><span class=\"token operator\">&amp;</span>u1<span class=\"token punctuation\">)</span> <span class=\"token comment\">// orm.Save(&amp;u1) ORM语言，它可能会翻译成下面的SQL语句进行执行</span>\n<span class=\"token punctuation\">}</span>\n</code></pre>\n<div class=\"line-numbers-wrapper\"><span class=\"line-number\">1</span><br><span class=\"line-number\">2</span><br><span class=\"line-number\">3</span><br><span class=\"line-number\">4</span><br><span class=\"line-number\">5</span><br><span class=\"line-number\">6</span><br><span class=\"line-number\">7</span><br><span class=\"line-number\">8</span><br><span class=\"line-number\">9</span><br><span class=\"line-number\">10</span><br><span class=\"line-number\">11</span><br></div><!--beforeend--></div><!--afterend--><p>对应SQL语句</p>\n<!--beforebegin--><div class=\"language-sql line-numbers-mode\"><!--afterbegin--><pre v-pre class=\"language-sql\"><code><span class=\"token keyword\">insert</span> <span class=\"token keyword\">into</span> userinfo <span class=\"token keyword\">values</span><span class=\"token punctuation\">(</span><span class=\"token number\">1</span><span class=\"token punctuation\">,</span> <span class=\"token string\">\"wujie\"</span><span class=\"token punctuation\">,</span> <span class=\"token string\">\"男\"</span><span class=\"token punctuation\">,</span> <span class=\"token string\">\"乒乓球\"</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\n</code></pre>\n<div class=\"line-numbers-wrapper\"><span class=\"line-number\">1</span><br></div><!--beforeend--></div><!--afterend-->",
