      "excerpt": "<h1 id=\"生命周期\"><a class=\"header-anchor\" href=\"#生命周期\">#</a> 生命周期</h1>\n<h2 id=\"入门\"><a class=\"header-anchor\" href=\"#入门\">#</a> 入门</h2>\n<p>简单代码</p>\n<!--beforebegin--><div class=\"language-rust line-numbers-mode\"><!--afterbegin--><pre v-pre class=\"language-rust\"><code><span class=\"token keyword\">fn</span> <span class=\"token function-definition function\">main</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span> <span class=\"token punctuation\">{</span>\n    <span class=\"token keyword\">let</span> myage<span class=\"token punctuation\">;</span>\n    <span class=\"token punctuation\">{</span>\n        <span class=\"token keyword\">let</span> age <span class=\"token operator\">=</span> <span class=\"token number\">19</span><span class=\"token punctuation\">;</span>\n        myage <span class=\"token operator\">=</span> <span class=\"token operator\">&amp;</span>age<span class=\"token punctuation\">;</span>\n    <span class=\"token punctuation\">}</span>\n    <span class=\"token macro property\">println!</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"{}\"</span><span class=\"token punctuation\">,</span> myage<span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\n<span class=\"token punctuation\">}</span>\n</code></pre>\n<div class=\"line-numbers-wrapper\"><span class=\"line-number\">1</span><br><span class=\"line-number\">2</span><br><span class=\"line-number\">3</span><br><span class=\"line-number\">4</span><br><span class=\"line-number\">5</span><br><span class=\"line-number\">6</span><br><span class=\"line-number\">7</span><br><span class=\"line-number\">8</span><br></div><!--beforeend--></div><!--afterend--><blockquote>\n<p>问题：</p>\n<p><code>age</code> does not live long enough\nborrowed value does not live long enoughrustc<a href=\"https://doc.rust-lang.org/error-index.html#E0597\" target=\"_blank\" rel=\"noopener noreferrer\">E0597<OutboundLink/></a></p>\n<p>main.rs(12, 5): <code>age</code> dropped here while still borrowed</p>\n<p>main.rs(13, 20): borrow later used here`</p>\n</blockquote>\n<p>说明<code>age</code>只在这个代码块里存活，如果通过引用进行“拿”出去调用，则无法使用。所以<code>rust</code>会有一个内置的生命周期检测。</p>\n<p>判断规则：<strong>myage 所处的生命周期，引用了比他小的生命周期里的 age 数据</strong>，会认为你的生命周期代码有误，不能编译。</p>\n",
