      "excerpt": "<h1 id=\"在-struct-中使用泛型\"><a class=\"header-anchor\" href=\"#在-struct-中使用泛型\">#</a> 在 struct 中使用泛型</h1>\n<h2 id=\"泛型\"><a class=\"header-anchor\" href=\"#泛型\">#</a> 泛型</h2>\n<p>定义不局限名称，可以写任意的一个字母，最好是大写，因为从编程以来，认识的使用泛型的基本都是使用的大写字母，但是肯定会有一对<code>&lt;&gt;</code>进行包裹。</p>\n<blockquote>\n<p>背景：</p>\n<p>现在有一个积分平台，老同学使用的是<code>i32</code>类型作为积分的类型；现在有一个需求要支持<code>f32</code>类型的，这就需要泛型来支持。</p>\n</blockquote>\n",
