      "excerpt": "<h2 id=\"何谓方法\"><a class=\"header-anchor\" href=\"#何谓方法\">#</a> 何谓方法</h2>\n<p><code>System.out.println()</code>前面我们遇到的这个是是怎么呢？</p>\n<ul>\n<li>System：是一个类</li>\n<li>out：是一个输出对象</li>\n<li>println：是一个方法</li>\n</ul>\n<blockquote>\n<p>Java 方法是语句的集合，它们在一起执行一个功能。</p>\n</blockquote>\n<ul>\n<li>方法是解决一类问题的步骤的有序组合</li>\n<li>方法包含于类或对象中</li>\n<li>方法在程序中被创建，在其他地方被引用</li>\n</ul>\n<div class=\"custom-block tip\"><p class=\"custom-block-title\">提示</p>\n<p>设计方法的原则：方法的本意是功能块，就是实现某个功能的语句块的集合。我们设计方法的时候，最好保持方法的原子性，<strong>就是一个方法只完成一个功能，这样有利于我们后期的扩展。</strong></p>\n</div>\n",
