      "excerpt": "<div class=\"custom-block tip\"><p class=\"custom-block-title\">提示</p>\n<ol>\n<li>\n<p>数组，集合都是对多个数据进行存储操作的，简称为容器。</p>\n<blockquote>\n<p>这里的存储指的是内存层面的存储，而不是持久化存储</p>\n</blockquote>\n</li>\n<li>\n<p>数组：特点</p>\n<ol>\n<li>\n<p>一旦指定了参数，那么长度就被确定了，就不可以更改</p>\n<!--beforebegin--><div class=\"language-java line-numbers-mode\"><!--afterbegin--><pre v-pre class=\"language-java\"><code><span class=\"token keyword\">int</span><span class=\"token punctuation\">[</span><span class=\"token punctuation\">]</span> arr <span class=\"token operator\">=</span> <span class=\"token keyword\">new</span> <span class=\"token keyword\">int</span><span class=\"token punctuation\">[</span><span class=\"token number\">6</span><span class=\"token punctuation\">]</span><span class=\"token punctuation\">;</span> <span class=\"token comment\">// 长度就直接确定了</span>\n</code></pre>\n<div class=\"line-numbers-wrapper\"><span class=\"line-number\">1</span><br></div><!--beforeend--></div><!--afterend--></li>\n<li>\n<p>对于数组来说，它一旦声明了类型以后，数组中只能存放该类型的数据。</p>\n</li>\n</ol>\n</li>\n<li>\n<p>数组：缺点</p>\n<ol>\n<li>不能随意修改长度</li>\n<li>删除一个元素、增加一个元素效率很低</li>\n<li>数组中实际元素的数量是没有办法获取的，没有提供对应的方法或者属性来获取</li>\n<li>数组存储：有序、可重复；对于无序的，不可重复的就不能满足要求</li>\n</ol>\n</li>\n</ol>\n<blockquote>\n<p>正因为上面的缺点，引入了一个新的存储数据的结构 -&gt; 集合</p>\n</blockquote>\n</div>\n",
      "lastUpdated": "2021/11/16, 21:40:50"
    },
