      "excerpt": "<h2 id=\"历史\"><a class=\"header-anchor\" href=\"#历史\">#</a> 历史</h2>\n<p>JDK5.0 新增 -- 注解(Annotation)，也叫<strong>元数据</strong>。</p>\n<h2 id=\"定义\"><a class=\"header-anchor\" href=\"#定义\">#</a> 定义</h2>\n<p>注解就是代码里的特殊标记，这些标记可以在编译，类加载和运行时被读取，并执行相应的处理。<strong>通过使用注解，程序员可以在不改变原有逻辑的情况下，在源文件中嵌入一些补充信息</strong>。代码分析工具、开发工具和部署工具可以通过这些补充信息进行验证或进行部署。</p>\n<p>使用注解时，要在其前面加上<code>@</code>符号，并把该注解当成一个<code>修饰符</code>使用。用于修饰它支持的元素。</p>\n<hr>\n<p><code>Annotation</code>可以像修饰符一样被使用，可以用于修饰包、类、构造器、方法、成员变量、参数、局部变量的声明，这些信息被保存在<code>Annotation</code>的<code>&quot;name=value&quot;</code>中。可以用来代替<strong>JavaEE 旧版中所遗留的繁冗代码和 XML 配置等</strong>。<code>JPA(Java的持久化API)</code>是基于注解的，<code>Spring2.5</code>以上都是基于注解的，<code>Hibernate3.x</code>以后也是基于注解的，所以注解是一种趋势，一定程度上可以说：<code>框架=注解+反射+设计模式</code>。</p>\n",
      "lastUpdated": "2021/11/27, 16:44:03"
