      "excerpt": "<h2 id=\"简介\"><a class=\"header-anchor\" href=\"#简介\">#</a> 简介</h2>\n<h3 id=\"概念\"><a class=\"header-anchor\" href=\"#概念\">#</a> 概念</h3>\n<blockquote>\n<p>JDBC 就是使用 Java 语言操作关系型数据库的一套 API</p>\n<p>全称：(<strong>J</strong>ava <strong>D</strong>ata<strong>B</strong>ase <strong>C</strong>onnectitity) Java 数据库连接。</p>\n</blockquote>\n<h3 id=\"本质\"><a class=\"header-anchor\" href=\"#本质\">#</a> 本质</h3>\n<p align=\"center\"><img src=\"https://gitee.com/wxvirus/img/raw/master/img/20211201195055.png\" alt=\"JDBC本质\" /></p>\n<p>期望：同一套代码操作不同的关系型数据库</p>\n<p><strong>Sun</strong>公司站出来了，定义了一套代码，JDBC，即一个规则，也就是 Java 语言里的接口，让不同的数据库厂商去实现各自的实现类。</p>\n<blockquote>\n<p>我们可以使用这套接口(JDBC)编程，真正执行代码的是驱动<code>jar</code>包中的实现类。</p>\n</blockquote>\n<h3 id=\"好处\"><a class=\"header-anchor\" href=\"#好处\">#</a> 好处</h3>\n<ul>\n<li>各数据库厂商使用相同的接口，Java 代码不需要针对不同数据库分别开发</li>\n<li>可以随时替换底层数据库，访问数据库的 Java 代码基本不变</li>\n</ul>\n",
      "lastUpdated": "2021/12/02, 23:14:06"
    },
